package productsum

import (
	"fmt"
	"sort"
	"strconv"
)

type SpecialArray []interface{}

// Tip: Each element of `array` can either be cast
// to `SpecialArray` or `int`.
func ProductSum(array []interface{}) int {
	// Write your code here.

	return help(array, 1, 0)
}

/*
如果需要两次类型断言，可以使用if elseif else结构
*/

func help(array SpecialArray, deep int, index int) int {
	sum := 0
	for index < len(array) {
		temp := array[index]

		if value, ok := temp.(SpecialArray); ok {
			param := value
			sum += help(param, deep+1, 0)
		} else if value, ok := temp.(int); ok {
			sum += value
		} else {
			fmt.Println("error")
		}
		index++
	}
	return sum * deep
}

func permute(nums []int) [][]int {
	sort.Slice(nums, func(i, j int) bool {
		return nums[i] < nums[j]
	})
	if len(nums) == 0 {
		return nil
	}

	permutions := make([][]int, 0)
	curPermutions := make([]int, 0)
	helpGet(nums, &curPermutions, &permutions)

	/*
		没有去重
		1.先再algoexpert中跑一边
		2.加入去重的功能再leetcode中run
	*/

	arrSet := make(map[string]struct{}, 0)
	ans := make([][]int, 0)
	for i := 0; i < len(permutions); i++ {
		tempString := ""
		for j := 0; j < len(permutions[i]); j++ {
			tempString += strconv.Itoa(permutions[i][j]) + " " // int 转 string 需要使用特定的 strconv.Itoa
			// string转int 使用 strconv.Atoi
		}
		if _, ok := arrSet[tempString]; ok {
			continue
		} else {
			ans = append(ans, permutions[i])
			arrSet[tempString] = struct{}{} // struct {} {}：表示struct类型的值，该值也是空。
			// struct {} {}是一个复合字面量，它构造了一个struct {}类型的值，该值也是空。
		}

	}

	return ans
}

func helpGet(restArray []int, curPermution *[]int, permutions *[][]int) {
	if len(restArray) == 0 {
		*permutions = append(*permutions, *curPermution)
	} else {
		for i := 0; i < len(restArray); i++ {
			newArray := make([]int, len(restArray))
			copy(newArray, restArray)

			newArray = append(newArray[:i], newArray[i+1:]...)

			newPermutation := make([]int, len(*curPermution))
			copy(newPermutation, *curPermution)

			newPermutation = append(newPermutation, restArray[i])

			helpGet(newArray, &newPermutation, permutions)
		}
	}
}

